import React from 'react';
import "../index.css";
import logo from "../images/logo.png";
import { NavLink } from "react-router-dom";

export default function Navbar() {

    function myFunction() {
        var x = document.getElementById("myTopnav");
        if (x.className === "navbar-right-container") {
            x.className += " responsive";
        } else {
            x.className = "navbar-right-container";
        }
    }

    return (
        <>
            <div className="navbar-container">
                <div className="navbar-left-container">
                    <NavLink to='/home'><img src={logo} alt='logo' /></NavLink>
                </div>

                <div className="navbar-right-container" id="myTopnav">
                    <a href="/home" className="button-1">Home</a>
                    <a href="/about" className="button-1">About</a>
                    <a href="/projects" className="button-1">Projects</a>
                    <a href="/contact" className="button-1">Contact</a>
                    <a href="javascript:void(0);" className="icon button-1" onclick="myFunction()">
                        <i className="fa fa-bars"></i>
                    </a>
                </div>
            </div>
        </>
    )
}
